import React from "react";
import Card from "./Components/Card";
import SDATA from "./SDATA";
let nCard = (val) => {
  return (
    <Card
      sname={SDATA[0].sName}
      img={SDATA[0].imgSrc}
      title={SDATA[0].title}
      link={SDATA[0].link}
    />
  );
};
let App = () => {
  return (
    <>
      <h1 className="heading_style">List of Top Web Series</h1>
    </>
  );
};

export default App;
